INSERT INTO `places` VALUES (2,1,NULL,'Sierra Palms Hotel','<p>The <strong>Sierra Palms Resort is</strong> the ultimate destination for both business travellers and tourists who are looking for comfort, productivity and entertainment.</p>',420,1568,1568,1568,'place','WP443 8.4743759 -13.2831891-2','Lumley Beach Rd, Freetown, Sierra Leone',8.47437590,-13.28318910,'[{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]','Contact no: +679-7890987','Phone number: 123456789','Address:  17350 State Highway 249 STE 220 #2044, Houston, 77064, USA',NULL,'2019-12-10 14:29:33','2020-09-01 10:32:25'),(4,1,NULL,'Sierra Leone Brewery Limited','The Sierra Leone Brewery, commonly known as Sierra Leone Brewery Limited, is the first and only brewery of international standards in the country.\r\n\r\nIt is not only one of the most viable businesses employing hundreds of workers and providing a livelihood for dozens of farmers, but it’s also a kind of historical institution that has seen governments including military governments, come and go since the country gained independence in 1961.\r\n\r\nAccording to company records, Heineken and United African Company (UAC) began construction of the Sierra Leone Brewery Limited in October 1961 at the Wellington Industrial Estate in Freetown and the first brew was mashed-in on the 23 November 1962. The first brand to be brewed was Star Lager.\r\n\r\nSince then the brewery has been servicing the country’s beer needs, closing and re-opening during and after the the economically debilitating civil war.',382,1499,1499,1499,'place','WP405 8.4414038 -13.1646462-4','Unnamed Road, Freetown, Sierra Leone',8.44140380,-13.16464620,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-13 21:42:22','2020-01-16 21:21:46'),(5,1,NULL,'Tacugama Chimpanzee Sanctuary','Preserving Sierra Leone\'s Wildlife since 1995. Located just on the outskirts of Freetown, in the Western Area Peninsula National Park, Tacugama Chimpanzee Sanctuary was founded in 1995 by conservationist Bala Amarasekaran and his wife Sharmila. Initially established to enforce wildlife laws and rescue and rehabilitate orphaned chimpanzees, Tacugama has grown into a diverse conservation organization.\r\n\r\nCaring for close to 100 chimpanzees on-site, Tacugama is also actively engaged offsite in community outreach, wildlife field research, environmental sustainability, conservation education and alternative livelihoods programs.\r\n\r\nTacugama is also an eco-tourism hub for Freetown – home to 6 eco-lodges, and a variety of activities for both tourists and Freetowners alike to participate in.',404,1536,1535,1536,'place','WP427 8.4195281 -13.2053244-5','Congo Dam Access Rd, Sierra Leone',8.41952810,-13.20532440,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-16 21:02:35','2019-12-16 21:15:40'),(6,1,NULL,'Sierra Leone National Museum','Sierra Leone’s National Museum is located at the centre of Freetown under the branches of the city’s famous Cotton Tree. It is the hub of many cultural activities in Freetown and holds an important collection of Sierra Leonean artefacts and artworks.\r\n\r\nThe museum was opened in 1957 as the museum of the Sierra Leone Society, a ‘learned society’ whose members included colonial officials and prominent members of Freetown’s Krio community. With the demise of the Sierra Leone Society in the mid-1960s, the museum came under the control of Sierra Leone’s Monuments and Relics Commission and Ministry of Tourism and Cultural Affairs, and thus became the Sierra Leone National Museum.\r\n\r\nThe museum has rarely benefitted from significant financial resources and has survived largely due to the commitment of its dedicated staff. It still occupies what was originally intended to be temporary accommodation in the old Cotton Tree railway station at the junction of Siaka Stevens Street and Pademba Road. The German Embassy funded an extension to the museum, which was opened in 1987 to mark the bicentenary of the founding of Freetown.',405,1537,1537,1537,'place','WP428 8.4868782 -13.2360727-6','35 Siaka Stevens St, Freetown, Sierra Leone',8.48687820,-13.23607270,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,1,'2019-12-16 21:28:40','2020-01-19 11:48:10'),(7,1,NULL,'Bintumani Hotel','Hotel Bintumani is situated at the peak of the hills around Aberdeen in Freetown. This is Sierra Leone\'s largest hotel. Bintumani is about 10 to 15 minutes walk to Lumley Beach and the hovercraft and helicopter services which link Freetown to the airport at Lungi.\r\n\r\nBintumani Hotel also offers a conference centre that sits more than 250 in a comfortable atmosphere with good communication facilities ideal for business use.',420,1568,1568,1568,'place','WP443 8.4969124 -13.2875317-7','Unnamed Road, Freetown, Sierra Leone',8.49691240,-13.28753170,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-16 21:42:20','2019-12-30 19:02:48'),(8,1,NULL,'Chicken Town','There’s a reason fried chicken is so popular: it’s tasty and satisfying, and doesn’t break the bank. However, studies show that eaten in large quantities and too regularly, it can lead to high levels of obesity and ill health – particularly in children and young people.\r\n\r\nChicken Town’s aim is to provide food that tastes good and is nutritious and healthy. The secret to our fried chicken is in the way we choose and cook our meat. All our birds are herb-fed, free-range chickens from Swaledale in the Yorkshire Dales – we think they taste much better than battery-farmed animals. To create the succulent chicken morsels with a crisp coating that everyone loves, we gently steam the meat before marinating it in buttermilk, covering it in a Panko crumb, and flash-frying it in rapeseed oil.\r\n\r\nThe reason this great food doesn’t hurt your pocket is because of the way we run our business. Chicken Town is a social enterprise, which means that we use what we earn to keep our prices down and benefit our local community.',409,1548,1546,1548,'place','WP432 8.4760084 -13.2481323-8','Youyi Building, Freetown, Sierra Leone',8.47600840,-13.24813230,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-16 21:59:30','2019-12-30 23:17:40'),(10,1,NULL,'Seabird Express','Provides a speedboat service from Freetown to Lungi International Airport.',417,1562,1562,1562,'place','WP440 8.4947622 -13.263715899999966','High Broad St, Freetown, Sierra Leone',8.49476220,-13.26371590,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-18 14:21:25','2019-12-18 14:21:25'),(12,1,NULL,'Bunce Island Fortress','Twenty miles up the Sierra Leone River from Freetown is Bunce Island, the site of a former British slave trading castle. The castle operated from 1670 and 1808 and sent around 50,000 enslaved humans from the African Rice Coast to the Americas. Most of the slaves who went through Bunce Island were sent to South Carolina and Georgia, where knowledge of rice cultivation was in high demand.\r\n\r\nThe island was also the site of an often forgotten battle during the American Revolutionary War when the (colonial-allied) French attacked and damaged the castle in 1779. The castle had been damaged or destroyed in a number of other previous attacks by the French and pirates (including one by Black Bart), but was rebuilt after each attack.\r\n\r\nAfter the British outlawed the slave trade in 1807, the castle was used briefly as a trading post, a plantation, and a sawmill before it was abandoned around 1840. One hundred seventy years later, vegetation overgrowth clings to the deteriorating ruins of the castle (parts of which still include a second-story level) and its fortress. Other remains include the island’s slave yards, watchtowers, prison, a factory house, dormitories, several 18th-century cannons, and a graveyard.\r\n\r\nIn 1948, the island was officially protected by Sierra Leone, but historical preservation efforts have been delayed by civil war and other issues. In 2008, the World Monuments Fund declared the island one of the world’s “100 Most Endangered Sites,” but a recent joint U.S.-Sierra Leone five-year preservation effort looks hopeful and is in the process of preserving the site and erecting a museum on the island.\r\n\r\nThe island has been called “the most important historic site in Africa for the United States,” and descendants of slaves increasingly make the pilgrimage to view the emotional and tragic site through which their enslaved ancestors were taken, held captive, and sold.',22,62,62,62,'place','EP022 8.4606 -11.7799-12','Sierra Leone',8.46060000,-11.77990000,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-20 21:11:42','2020-01-18 18:42:39'),(13,1,NULL,'Outamba Kilimi National Park','Outamba-Kilimi National Park is located in northwest Sierra Leone near the border with the Republic of Guinea. The park is divided into two areas, Outamba (741 km²) and Kilimi (368 km²). The area became a game reserve in 1974, and was formally gazetted as a National Park in October 1995. The park is named after its highest peak in one part, Mount Outamba, and its longest river in the other, River Kilimi. The area was originally chosen for preservation as it contains a large number of chimpanzees. The vegetation is called woodland savanna, with a mixture of jungle and savanna. \r\n\r\nWildlife includes primates such as chimpanzees, colobus monkeys and sooty mangabeys; hippopotamuses and pygmy hippos; elephants; common warthogs; rare bongo antelopes and over a hundred species of birds. The UN Environment Programme lists the Outamba Area as protected. .',211,871,871,871,'place','NP211 9.2475837 -12.1632718-13','Bombali, Sierra Leone',9.24758370,-12.16327180,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-20 21:29:43','2020-01-18 18:38:57'),(14,1,NULL,'Cotton Tree','The Cotton Tree is a Ceiba pentandra, also known commonly as a kapok tree, a historic symbol of Freetown, the capital city of Sierra Leone. According to legend, the \"Cotton Tree\" gained importance in 1792 when a group of former African American slaves, who had gained their freedom by fighting for the British during the American War of Independence, settled the site of modern Freetown. These Black Loyalist settlers, called \"Nova Scotians\" because they came from Nova Scotia after leaving the United States and before they decided to go back to Africa or, \"Navatians\" in Sierra Leone, founded Freetown on March 11th 1792\r\n\r\nPeople first landed on the shoreline and walked up to a giant tree just above the bay and held a Thanksgiving service there, gathering around the tree in a large group and praying and singing hymns to thank God for their deliverance to a free land. Its exact age is unknown, but it is known to have existed in 1787.[2]\r\n\r\nThe tree is the oldest cotton tree in Freetown, Sierra Leone or possibly in the world. It stands near the Supreme Court building, music club building, and the National Museum. The tree has a lot of unique history. Under this tree is where the Nova Scotian settlers first prayed upon landing on the soil of Liberty and freedom, in other words to start their new lives as free people. They regard it as the symbol of their present situations during that period. Before these newly freed Africans arrived, Sierra Leone had already been inhabited. These newly arrived Africans gave the capital the name it bears today FREETOWN. Even today, Sierra Leoneans still pray and make offerings to their ancestors for peace and prosperity beneath the Cotton Tree.',408,1544,1543,1544,'place','WP431 8.4871072 -13.235809-14','32 Walpole St, Freetown, Sierra Leone',8.48710720,-13.23580900,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-20 23:05:19','2020-01-18 18:35:34'),(15,1,NULL,'Gola Rainforest National Park','The project area covers a 110 km stretch of land within seven Gola Forest chiefdoms. The importance of these forests as a timber reserve has been recognised for over 100 years, with Forest Reserves first declared in 1926–1930 and extended in the 1950s to over 70,000 hectares. The Gola Forest is a remnant of the Upper Guinea Forest of West Africa, one of the 25 biodiversity hotspots identified by Conservation International, and a major Endemic Bird Area.\r\n\r\nGola is home to over 330 bird species, and is one of the few areas that holds an almost complete selection of the endemic birds of the Upper Guinea Forests, including several bird species of conservation concern. It is one of the last strongholds for the Endangered Gola Malimbe Malimbus ballmanni, whose numbers have dwindled to an estimated 6,000–15,000 individuals, and is also important for the Vulnerable (and extraordinary) White-necked Picathartes Picathartes gymnocephalus and White-breasted Guineafowl Agelastes meleagrides.\r\n\r\nThe mammal fauna is also impressive: at least 50 species with a highly threatened megafauna. Endangered or Vulnerable species include Forest Elephant Loxodonta (africana) cyclotis, Pygmy Hippopotamus Choeropsis liberiensis, Western Chimpanzee Pan troglodytes verus, Jentink’s Duiker Cephalophus jentinki, Zebra Duiker Cephalophus zebra, Liberian Mongoose Liberiictis kuhni, Diana Monkey Cercopithecus diana, Sooty Mangabey Cercocebus atys and West African Red Colobus Procolobus badius.\r\n\r\nThere is much to learn about the forests’ invertebrate biodiversity, though around 600 species of butterfly occur, and the forest is known to contain around 1,000 plant species.\r\n\r\nThe forest has been commercially exploited in the past, with over 20,000 hectares being logged between the 1960s and 1980s, and has recently been under pressure for the exploitation of diamonds and iron ore and was the subject of a recent report by Global Witness. However, since the 1990s, the forest has been the subject of a conservation project to protect the forest for the long term whilst ensuring the involvement and livelihood improvement of forest edge communities. The project is a collaboration between the Government of Sierra Leone, the Conservation Society of Sierra Leone and the Royal Society for the Protection of Birds. A similar action has also been instituted across the Liberia border in the Liberian Gola Forest Community, since the two communities share similar cultures and people as well as animal and plant species. The Lofa-Mano National Park has been proposed in northeastern Liberia, adjoining the park. \r\n\r\nLocals have traditionally accessed the reserves to farm, hunt and extract timber to supplement the livelihood activities carried out around their villages.  Non-timber forest products not available in community lands such as fruits, nuts, traditional medicines and building materials are important to the local, subsistence-dominated economy. Other forest ecosystem services such as water provision, the regulation of local climate and carbon storage/sequestration are important both globally and locally.',38,139,135,139,'place','EP038 8.0799992 -10.7097867-15','Kailahun, Sierra Leone',8.07999920,-10.70978670,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-20 23:20:08','2020-01-18 18:37:14'),(16,1,NULL,'National Railway Museum','The Sierra Leone National Railway Museum was opened in 2005 in the old railway workshops in the Cline Town area of Freetown. The museum has a fine collection of historical 2’6” gauge railway locomotives, coaches, wagons and related equipment from the former Sierra Leone Railway that once connected Freetown to Pendembu via the second principal city of Bo, and to the major town of Makeni.\r\n\r\nEstablished in 1895, the Sierra Leone Railway started its first passenger train service to the provinces in 1898. The Railway was closed in 1975 and the locomotives and carriages that now form the major part of the museum’s collection languished in the Cline Town workshops for 30 years, suffering from numerous acts of vandalism during the civil war.\r\n\r\nThe collection is now under restoration by local skilled employees, with guidance and support by the UK National Railway Museum. Exhibits include:\r\n\r\n    Beyer-Garratt steam locomotive No.73 of 1955;\r\n    Hunslet steam tank locomotive No.81 of 1947;\r\n    Manning Wardle steam locomotive \'Nellie\' of 1915;\r\n    Diesel locomotives from 1958 and 1959;\r\n    HM The Queen\'s Royal Coach from 1961;\r\n    Various passenger carriages;\r\n    Plus hundreds of photographs and artefacts related to the Sierra Leone Railway.',397,1523,1523,1523,'place','WP420 8.4901735 -13.208726800000022','Edwin Ln, Freetown, Sierra Leone',8.49017350,-13.20872680,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-20 23:27:39','2019-12-20 23:27:39'),(17,1,NULL,'Grave of Captain Lendy','Waiima is situated in the Fiama Chiefdom. It was here at Waiima in 1893 that the British and the French Forces who were allies fired accidentally on each other while pursuing Samory’s sofa warriors. It was a dark, misty morning, when the British fought the French, each party mistaking the other for the sofa warriors.\r\n\r\nBy the time the mistake was realised, Captain Lendy on the British side and Lieutenant Maritz on the French side had been killed. Some other soldiers also died together with these two officers. Both Lendy and Maritz were buried on the spot and afterwards their brother officers erected a memorial cross over them. In 1933 a new and larger memorial was erected incorporating the original cross. The new memorial was erected by the Sierra Leone Government in memory of the soldiers who perished that day.\r\n\r\nClose by was a steep bare gradient of granite leading to a high hill; upon the summit of which, standing out in relief against the sky, were a number of armed war-boys who had been sent from the town of Waima, which was an hour’s march further on. As we approached them it seemed as if they were under some misapprehension as to who or what we were. They had evidently come out with the intention of fighting. The Governor, however, who was at the head of the column, went forward with the interpreter and reassured them of the peacefulness of the expedition. With this explanation they were satisfied and pleased, and subsequently conducted us to the town of Waima, which was situated in a valley with some large cotton trees around it.\r\n\r\nThe town consists of about fifty huts.\r\n\r\nIt was on the 16th of April that we arrived at Waima. This was about four months after the unfortunate collision between the French and the English had occurred. Many of the huts were riddled by bullets. It will be sufficient for the purpose of this narrative to mention the kindly care which the Governor bestowed upon the graves of French and English, officers and men alike, who fell in that much-to-be-regretted action. By his orders the burial ground was cleared and the graves fenced in before we took our departure from that melancholy town, with its sorrowful surroundings and its most painful associations.\r\n\r\nThe memorials are well maintained in a brushed enclosure a short distance from the present village of Waiima. A number of impressive cotton trees tower above the area, which is evidently the site of the old village of Waiima',97,305,305,305,'place','EP097 8.8009637 -10.7736327-17','Unnamed Road, Sierra Leone',8.80096370,-10.77363270,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-21 11:46:34','2020-01-19 11:41:32'),(19,1,NULL,'Kamabai Rock Shelter','kamabai',115,415,414,415,'place','NP115 9.1418712 -11.9594122-19','Kabala Hwy, Kamabai, Sierra Leone',9.14187120,-11.95941220,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-21 19:21:28','2020-01-18 18:33:27'),(20,1,NULL,'Martello Tower','In the early years of the 19th century, the Temne, under King Tom, made frequent attacks on Freetown. Fort Thornton was not yet completed, and Governor Day in 1805, caused to be erected for the defence of Freetown, a Martello Tower which was a replica of the towers at that time being put up all along the South coast of England to counter the threatened invasion by Napoleon I. Governor Day got the latest model from the Board of Ordinance and on April 11th, 1805, he led a procession up Wansey Hill, renamed “Tower Hill”, to lay the foundation stone. It is believed that no shot was ever fired in anger from the tower.\r\n\r\nRound about 1870, piped water was first introduced in Freetown. The initial supply came from the upper waters of Nicol Brook. The pipe was laid to Tower Hill Barracks, and then down to the old military hospital to Government House and on into the town. About this time the tower was truncated and a large iron water tank placed on the top, controlling the water supply to Government House.\r\n\r\n[The tower was proclaimed a national monument to save it from demolition when the new Parliament Building was being built in 1961.',405,1537,1537,1537,'place','WP428 8.482326 -13.2350492-20','37 Fort St, Freetown, Sierra Leone',8.48232600,-13.23504920,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-21 19:34:26','2020-01-19 11:42:28'),(21,1,NULL,'Tiwai Island Wildlife Sanctuary','Tiwai is a community conservation programme, managed by the Tiwai Island Administrative Committee (TIAC), which represents both communities, government, Universities & conservation organizations. All funds raised go towards running the project as well as supporting the Community Development Fund, to help finance community initiated programmes.\r\n\r\nThe Moa river journeys from Guinea, close to the tip of the river Niger, travelling south across Sierra Leone & flushing out in to the Atlantic Ocean. The wide open river hosts a cluster of islands, including Tiwai. You can take a river tour in canoe or motorboat, watching birds fly overhead or river turtles surface. For explorers, night tours search for the elusive and extremely rare pygmy hippopotamus.\r\n\r\nAt the tip of Tiwai’s northern edge lies one of two stretches of sandy beach. Access to the beach is seasonal, as in the rainy season, the sandy mounds are hidden underwater. You can enjoy a cooling swim in the fresh water … look out for river otter paw prints as they sometimes like to play on the sand.\r\n\r\nWebs of trails weave through the Tiwai forest, allowing visitors and researchers to explore up to 50 km of walking paths. If you move silently through the forest, you can glimpse some of the rarest & most colourful primates in the world, such as the Diana & Colobus monkeys.\r\n\r\nTiwai facts\r\n\r\n    Tiwai in Mende language means big island\r\n    Tiwai Island is Sierra Leone’s first community conservation programme\r\n    At 12 sq kms, Tiwai is one of Sierra Leone’s largest inland islands\r\n    Tiwai has one of the highest concentration and diversity of primates in the world with 11 species\r\n    The Gola Forest Reserves, which host the last significant patches of rainforest in Sierra Leone, spread east of Tiwai to the Liberian border',32,109,104,109,'place','EP032 7.8938103 -11.2523792-21','Kenema, Sierra Leone',7.89381030,-11.25237920,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-21 19:53:18','2020-01-19 11:43:57'),(22,1,NULL,'Red Lion Bakery','Born out of the need to feed a family during the rationing period of the Second World War, Red Lion Bakery has been a family‐ owned and operated business since 1944.\r\nMr. Ashwood, a Police Officer, lived at the Police Barracks in Kingtom with his family, which then consisted of 6 children; Hodson, Pamela, Gloria, Gracie, Jestina, and their baby, Joseph. One day, Mr. Ashwood brought home a single  loaf of bread from Whitfield’s Bakery, to be shared by the household.  Bread was being rationed and also, cost one shilling - at the time, an exorbitant amount!\r\n\r\nA  loaf of bread was of course inadequate to feed the entire household, so, inspired by her late mother, Annie Asgill who used to bake cakes in a pot during festive seasons, Mrs. Ashwood decided to make bread in a pot.  She bought all the necessary ingredients, and after several unsuccessful attempts, with varied results;  hard as stone or completely soggy, she conquered!  With joy, she took some samples to the neighbors. It was a success!  so she started making extra bread for sale.\r\n\r\nAs the news spread, the business progressed gradually and by 1948 it was a recognized farm house Bakery at Bolling Street, Kingtom; A small oven was bought and expert bakers engaged. The business initially started under the name of Ashwood, Sons and Daughters (ASSADS).  Mr. Ashwood,  then renamed the Bakery, Red Lion after his favorite “watering hole” in London.\r\n\r\nThis is the birth of Red Lion Bakery, now at 13 Bolling Street, Kingtom, with a full-time staff of 25 employees and growing. Several retail shops across Freetown, owned and operated by independent distributors carry Red Lion Bread, complementing the flagship bread shop at 65 Siaka Stevens Street.\r\n\r\nIn 1988,  ownership passed on to her four daughters: Pamela Grant, Gloria Dillsworth, Gracie Williams and Jestina Jones. Over the last 25 years, all four have been involved in co-managing the business. For 10 years till 2013, Jestina the youngest, was the Managing Director and ran it successfully through very difficult times until her death, in July of that year.\r\n\r\nIn early 2013, the owners determined it necessary to transition the business to the 3rd Generation. Cyril Grant and Michelle Jones, grandchildren of the founder, have taken up the challenge.\r\n\r\nThe New Red Lion Bakery is open for business.....and we value all our new and returning customers.\r\n\r\nWith  a solid name brand recognition and our commitment to Ethel Ashwood\'s vision and desire, we bring continuity of tradition and quality......We are determined to take it through another 70 and more years!',408,1543,1543,1543,'place','WP431 8.4880417 -13.2459035-22','Rolling St, Freetown, Sierra Leone',8.48804170,-13.24590350,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-22 12:19:24','2020-01-16 21:20:18'),(23,1,NULL,'Country Lodge Hotel','Enjoying a spectacular and panoramic view of the Atlantic Ocean, Country Lodge Hotel is situated on the hill of Freetown.\r\nIt is minutes away from the embassy area and the world famous colonial houses in Hill station and only 4km from the beach.\r\nAt Country Lodge Hotel, every room and suite provides state of the art services, in an elegant and modern design.\r\nAmenities such as the panoramic view swimming pool, restaurants, and tennis court are there for you to enjoy. We pride ourselves in providing a warm and caring service to all our clients and make their stay a most memorable one.',413,1556,1556,1556,'place','WP436 8.4590059 -13.2568496-23','Unnamed Road, Freetown, Sierra Leone',8.45900590,-13.25684960,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-25 23:37:15','2019-12-30 18:37:58'),(24,1,NULL,'Radisson Blue Hotel','Across the road from Lumley Beach, this upscale hotel is 9 km from Freetown and 35 km from Lungi International Airport.\r\n\r\nRefined rooms provide free Wi-Fi, flat-screen TVs and safes, plus tea and coffeemaking facilities. Some have balconies with ocean or garden views, and espresso machines. Upgraded rooms add minibars, and access to a private lounge. Suites feature living areas. Room service is available 24/7.\r\n\r\nAmenities include a chic restaurant with a terrace, and a piano bar, as well as a colourful cafe. There\'s also an outdoor pool, a private beach and a gym, in addition to 2 tennis courts and running trails. Breakfast is offered.',420,1568,1568,1568,'place','WP443 8.4921213 -13.289842-24','17 Lumley Beach Rd, Freetown, Sierra Leone',8.49212130,-13.28984200,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-25 23:42:14','2019-12-30 18:44:58'),(25,1,NULL,'Atlantic Lumley Hotel','The Atlantic Lumley Hotel is a luxury seafront hotel nested in the lovely Lumley Beach. The hotel is a mere 15 minute drive from Freetown which is the capital city of The Republic of Sierra Leone. From our breathtaking display of contemporary designed lobby with 2 observation elevators (a first in Sierra Leone), this star rated hotel cater for both short and long stays in the finest living atmosphere. \r\n\r\n“LOFT EATALICIOUS” serves seasonally inspired buffet as well as a la carte menus with international influences in a fashionable décor. This dining venue with a city vista offers breakfast, lunch & dinner with an authentic Italian culinary flair and local favorites to be enjoyed either indoors or outdoors adjacent to the beach.\r\n\r\n“THE ATRIUM” serves designer snacks, cocktails and refreshments in a chic setting. Relaxing during the day and transforms to a lively venue with live piano performance in the evening, this is the perfect place for unwinding and enjoying drinks with friends and colleagues after a long day of business.\r\n\r\n“DICKENS’ BAR” is an English style pub where a wide selection of branded beers are served. Here guests can also choose from an extensive list of rare imported Wine, Whisky and Champagne. Music, Sports and Drama broadcasting throughout the night by our giant TV screens.\r\n\r\n“THE PASTRY & CHOCOLATE SHOP” offers daily fresh baked pastries and homemade chocolate. Guests can also order special designed birthday cakes and purchase assorted gift items.',420,1568,1568,1568,'place','WP443 8.4774826 -13.2839206-25','Lumley Beach Road, Freetown, Sierra Leone',8.47748260,-13.28392060,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-25 23:46:47','2019-12-30 18:40:35'),(26,1,NULL,'Home Suites Hotel','With the emphasis on style and sophistication in a choice of our prime located property at Aberdeen, Home Suites Boutique Hotel always go further in ensuring your stay encompasses all the friendly comforts of home in a luxurious setting.\r\n\r\nNot only are all our suites designed and furnished with everything from fully fitted kitchens to beautifully equipped bathrooms, but the service you\'ll receive, establishes a level of comfort, convenience and attention to detail that is the hallmark of our Suites.\r\nFrom the moment you make your initial inquiry until the end of your stay, Our team will be on hand to make sure your stay is as enjoyable and trouble-free as possible.\r\n\r\nAt Home Suites Boutique Hotel, the multi-functional living room can hold a business meeting or friendly visitors. If you need to balance work commitments with social engagements and personal fulfillment, why shouldn’t your apartment support your lifestyle?\r\n\r\nWe’ve also introduced various space saving features like compact yet fully-equipped kitchens, 46 inches or 51 inches TVs and comfortable beds so the space really works for you With broadband internet and IDD access, cable TV to channel breaking world news, it’s easy to stay well-connected whether you’re a road warrior or traveling for fun.\r\n\r\nWhenever it’s time to call it a day, the space can easily convert from office to a salon for some quiet rejuvenation.\r\n\r\nMake yourself at home at Home Suites Boutique Hotel. If you are spending a month or more in Freetown, nothing beats having a place that you can call your own.\r\nOur residential style spaces and amenities are designed for intrepid travelers who value indulgent homes comforts and conveniences as much as they do new experiences.\r\n\r\nWhether for work or leisure, we are committed to taking care of every minute detail so that you can focus on experiencing your life abroad to the fullest. Embarking on new discoveries doesn\'t mean that you have to miss out on warmth and familiarity.\r\n\r\nAt Home Suites Boutique Hotel, we welcome you to live the way you want and stay for as long as you wish..',420,1568,1568,1568,'place','WP443 8.4946543 -13.2873808-26','78A Cape road, Bintumani Drive, Aberdeen, Freetown, Sierra Leone',8.49465430,-13.28738080,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-25 23:53:16','2019-12-30 18:41:56'),(27,1,NULL,'Roys Hotel','Stop by our cozy, kid-friendly restaurant and bar, where we serve-up a delicious menu which includes our notable cocktail selection and vegetarian options. For your entertainment, we have live music. We also offer outdoor seating and catering. Reservations accepted, so feel free to book in advance. We look forward to welcoming you!',420,1568,1568,1568,'place','WP443 8.4795829 -13.2849813-27','54 Lumley Beach Rd, Freetown, Sierra Leone',8.47958290,-13.28498130,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-25 23:58:48','2019-12-30 18:49:34'),(28,1,NULL,'Kimbima Hotel','Set in Freetown, Golden Tulip Essential Kimbima boasts a fitness centre and a bar. Guests can make use of the business facilities available on site. All rooms at the hotel are air-conditioned. While some rooms enjoy garden or ocean views, all units feature outdoor furniture.\r\n\r\nTreat yourself with a spectacular view of the Atlantic ocean from our Sea view rooms. For nature lovers , we have Garden view rooms with private balconies. Chill out in the balconies of our Standard rooms or try our Junior suites at the 3-star Golden Tulip Essential Freetown Hotel. Our Executive Suites offers a lounge ,private bar and kitchenette.\r\n\r\nAt the Golden Tulip Essential Freetown Hotel, we offer an International cuisine with a variety of fresh seafood right from the Atlantic ocean. The restaurant is open from morning till late night. Enjoy our 24 hours/24 room service. We have a fantastic Sea view terrace for corporate dinners,cocktails and also private events and weddings. \r\n\r\nDelectable cuisine with a panoramic view\r\n\r\nKimbima Terrace and Bar is a perfect outlet to sample the traditional food of Sierra Leone, and the globally-influenced menu also offers Continental cuisine. This hotel restaurant focuses on fresh , ingenius, and contemporary cuisine. The menu features food items from accross the globe. Thai chicken green curry comes from the far east and at the same time we have Jamaican jerk chicken from the Carribean. Without forgetting the spicy Indian curry and the signature Russian dish: Beef Stroganoff .',420,1568,1568,1568,'place','WP443 8.4984737 -13.2898113-28','Unnamed Road, Freetown, Sierra Leone',8.49847370,-13.28981130,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\