"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-26 00:18:13','2020-01-05 14:24:12'),(31,1,NULL,'Mamba Point Lagoonda','Mamba Point is one of Freetown\'s most popular (and expensive) restaurants. Come for dinner in the chic dining room, or just to sink a few cocktails and smoke on a shisha pipe on the expansive terrace, which has gorgeous views over Man o\' War Bay. On the menu are grilled fish and meats, pastas, and excellent sushi. There\'s a casino upstairs.',420,1568,1568,1568,'place','WP443 8.4966793 -13.2952038-31','Unnamed Road, Freetown, Sierra Leone',8.49667930,-13.29520380,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-26 00:26:27','2019-12-30 23:43:02'),(32,1,NULL,'Basha Bakery','Tasty grilled chicken and Lebanese fast food are the name of the game at this cafe and bakery, which also does top notch cakes and Middle Eastern sweets.',419,1567,1565,1567,'place','WP442 8.4780987 -13.2720101-32','70 Wilkinson Road, Freetown, Sierra Leone',8.47809870,-13.27201010,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2019-12-26 00:32:08','2019-12-30 23:30:01'),(33,1,NUL