,409,1549,1546,1549,'place','WP432 8.4889143 -13.2333075-48','18 Siaka Stevens St, Freetown, Sierra Leone',8.48891430,-13.23330750,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,1,'2020-01-02 23:57:49','2020-01-14 00:58:26'),(49,1,NULL,'SN Brussels','The history of Brussels Airlines dates back to 2002 when mother company SN Airholding was created by a group of about 40 investors.\r\n\r\nThe primary aim of the investors was to ensure the continuity of a reliable air connection to and from Brussels, the capital of Europe, and this in the context of the extensive perturbations caused by Sabena’s cessation. The new company was called SN Brussels Airlines, and it posted its first positive results already in 2003.\r\n\r\nIn October 2004, it was decided that SN Brussels Airlines and the lowcost airline Virgin Express would join together under the general ownership of SN Airholding, but would each retain their brand and operations independence in the market. \r\n\r\nBrussels Airlines is backed up by more than 90 years of Belgian aeronautical experience.\r\n\r\nOn September 15th 2008, the Lufthansa Group announced its purchase of a stake in the Belgian airline company. In June 2009 the EU Commission granted regulatory approval for this strategic partnership between Brussels Airlines and Lufthansa. The decision paved the way for Lufthansa to acquire an initial 45% stake in SN Airholding SA/NV, the parent company of Brussels Airlines. As from January 2017, SN Airholding is 100% owned by Deutsche Lufthansa AG.\r\n\r\nBrussels Airlines is an official member of Star Alliance since December 9th 2009.',409,1549,1546,1549,'place','WP432 8.4884169 -13.2340729-49','22 Siaka Stevens St, Freetown, Sierra Leone',8.48841690,-13.23407290,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,3,'2020-01-03 00:01:07','2020-01-14 00:59:09'),(50,1,NULL,'Air France','Whether you\'re looking for a last-minute London - Freetown (SIERRA LEONE) flight or a flight to a destination more further afield, take advantage of our lowest prices for your travel dates on this site. With our Calendar you can easily find month by month the cheapest prices for a flight with Air France. Take a look at the 6 next months and find the best price for your flight from London (LON) to Freetown(FNA) or directly pick up your departure date if your trip to Freetown (SIERRA LEONE) is already scheduled.',409,1549,1546,1549,'place','WP432 8.4884169 -13.2340729-50','22 Siaka Stevens St, Freetown, Sierra Leone',8.48841690,-13.23407290,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,2,'2020-01-03 00:07:40','2020-01-14 00:58:53'),(51,1,NULL,'Royal Air Maroc','Travel Business Class with Royal Air Maroc and discover our new standards of comfort on board: more spacious cabins, individual entertainment programmes, leather seats, delicious and varied food – experience a journey that combines comfort, pleasure and serenity.\r\nChoose Business Class for long-haul flights*\r\nWith its new cabins, Royal Air Maroc strives to enhance your trip: tantalise all your senses, try out our new Business Class for long-haul flight.\r\n\r\n-Medium-Haul -\r\nTry out our Business Class on medium-haul flights and enjoy quality meals comparable to those served on a long-haul flight...\r\n\r\nWarmly welcomed by our cabin crew, you will be able to settle down in your leather seat and enjoy our welcome drink.\r\n\r\nTake advantage of our cloakroom service and discover a range of products available for your comfort.\r\n\r\nTo make your trip a pleasant one, we have equipped each seat with a pillow, a blanket and a toiletry bag.\r\n\r\nOur seats have certain features that have been specially designed for your full relaxation during the flight.\r\n\r\nThese seats can be adjusted into a \"bed\" position, while the outer shell of your seat gives you the privacy to sleep without being disturbed.\r\n\r\nThere is also a \"massage\" function which you can try whenever you so desire throughout the flight.\r\n\r\nThe cabin crew of Royal Air Maroc is at your disposal, please do not hesitate to ask them for help.',409,1549,1546,1549,'place','WP432 8.4884169 -13.2340729-51','22 Siaka Stevens St, Freetown, Sierra Leone',8.48841690,-13.23407290,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,4,'2020-01-03 00:15:55','2020-01-14 00:59:31'),(52,1,NULL,'Managing Director','Mr. George Ndubuisi Meze is a fellow of Institute of Chartered Accountant of Nigeria (FCA) and an honorary member of Chartered Institute of Bankers of Nigeria. He holds MBA (International Business Management) from Lagos State University. He is also a graduate of Yaba College of Technology, Lagos (1983). Since joining the bank in 1992, George has served in various capacity such as branch head in several branches and Zonal head of Festac Zone, Lagos before his appointment as the MD/CEO of Zenith Bank Sierra Leone in 2010. He has since been leading the bank on the path of consistent growth and profitability thereby delivering value to the shareholders.\r\nHe has attended several executive and management training among which are managing people for Strategic Advantage at Lagos Business School (2004) and Leading Businesses into the Future at London Business School (2015).',407,1542,1541,1542,'place','WP430 8.4898733 -13.233081500000026','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-05 11:41:23','2020-01-05 11:41:23'),(53,1,NULL,'Country Head of Operations','Adewale Olukoya is the Country Head of Operations. He is an Associate of the ACCA (Association of Chartered Certified Accountants), a Fellow of Chartered Institute of Bankers of Nigeria (FCIB), an Associate of Chartered Institute of Stockbrokers (ACS), and also a Designate Compliance Professional of the Compliance Institute, Nigeria. He holds B.SC. Degree in Banking and Finance from Ogun State University (Nigeria), and MBA (Finance Specialization) from the University of Lagos.\r\nHe has over two decades of experience in the banking industry of which over 23 years has been spent in Zenith Bank PLC. In the course of his service to the Bank, he had been a Zonal Compliance Officer, with responsibility over 66 branches; Head, Bank Operations (Headquarters branch), with responsibility for Cash Management, Collections, Clearing, Domestic Funds Transfer Operations and other sundry operations. He is also very versatile in Enterprise Risk Management, Compliance and Credits.',409,1549,1546,1549,'place','WP432 8.4898733 -13.2330815-53','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-05 11:44:49','2020-01-05 11:46:24'),(54,1,NULL,'Head – Information Technology','Chris Olukotun graduated from University of Ilorin in 2002 with a second class upper Bachelor degree in Electrical engineering. He had his MBA from Lagos State University in 2008. He joined Zenith Bank Plc as an IT Engineer in 2004 where he served in various units such as Network Communication unit, Enterprise storage and Server administration unit before being seconded to start IT department of Zenith Bank Sierra Leone.\r\nHe has coordinated and pioneered deployment of several innovative electronic banking products and services for the bank. He holds several IT certifications and has attended several IT training courses. He is a member of the Nigerian Society of Engineers(NSE).',409,1549,1546,1549,'place','WP432 8.4871072 -13.235809','32 Walpole St, Freetown, Sierra Leone',8.48710720,-13.23580900,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"