 Loan Recovery, Enterprise Risk Management and Credit Risk Management Group.',409,1549,1546,1549,'place','WP432 8.4898733 -13.233081500000026','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-05 12:02:10','2020-01-05 12:02:10'),(57,1,NULL,'Head – Financial Control And Strategic Planning','Saidu Kamara holds a B.Sc (Hons) degree in Accounting and Finance from Fourah Bay College, University of Sierra Leone and MBA from Amity University. He is a qualified accountant of the Association of Chartered and Certified Accountant (ACCA) from the UK.\r\nPrior to his appointment, he worked for the Sierra Leone Cement Corporation (LEOCEM) for four years in the Finance department and went up to the position of Senior Accountant, afterwards he joined the Mining sector at Sierra Rutile Company as a Finance Superintendent and worked for three years, and move on to work as a Finance Superintendent for London Mining Company for four years.',409,1549,1546,1549,'place','WP432 8.4898733 -13.233081500000026','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-05 12:04:31','2020-01-05 12:04:31'),(58,1,NULL,'Head – Marketing','Miss Elizabeth S. Squire holds a BSc degree in Development and Economics from IAMTEC/Njala University, Sierra Leone. She is currently studying for postgraduate (Master’s) degree in Management from the University of Liverpool, United Kingdom.\r\nMiss Squire joined the bank’s marketing force in 2010. She has vast experience in leadership and marketing with both national and international background in Exceptional Customer Services and Relationship Management. Miss Squire has won several awards in the bank including leadership and best marketing staff awards for three consecutive years.',409,1549,1546,1549,'place','WP432 8.4898733 -13.233081500000026','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-05 12:08:01','2020-01-05 12:08:01'),(59,1,NULL,'About Zenith Bank SL','Zenith Bank Sierra Leone Limited is a subsidiary of Zenith Bank Plc., Nigeria. Zenith Bank Sierra Leone commenced banking operation in September 2008. The bank’s exceptional approach to excellent service delivery has endeared Zenith franchise to its teeming customers.Zenith Bank Sierra Leone Limited is a subsidiary of Zenith Bank Plc., Nigeria. Zenith Bank Sierra Leone commenced banking operation in September 2008. The bank’s exceptional approach to excellent service delivery has endeared Zenith franchise to its teeming customers.\r\n\r\nZenith Bank occupies a leading position in deployment of cutting-edge Information and Communication Technology (ICT) Infrastructure to create innovative products that meet the need of its customers.\r\n\r\nZenith Bank Sierra Leone leverages on large network of Zenith Bank group to render unparalleled service to its customers. Headquartered in Lagos, Nigeria, Zenith Bank Plc has over 500 branches spread across every part of Nigeria. It has other subsidiaries in: United Kingdom, Zenith Bank(UK) Limited; Ghana, Zenith Bank(Ghana) Limited; Gambia, Zenith Bank(Gambia) Limited.\r\n\r\nThe bank also has representative offices in South Africa, People’s Republic of China and United Arab Emirate.\r\n\r\nZenith Bank Sierra Leone Limited has its headquarter at 18-20 Rawdon Street, Freetown. We also have branches in Kenema (Eastern Region), Lumley(Freetown) and Freetown International Airport, Lungi (Nothern Region). We also have strategic branch expansion plan in place, this will enable us have our presence in every part of Sierra Leone.\r\n\r\nDriven by a culture of excellence and strict adherence to global best practices, the Bank has combined vision, skillful banking expertise, and cutting-edge technology to create products and services that anticipate and meet customers’ expectations; enable businesses to thrive and grow wealth for customers.',409,1549,1546,1549,'place','WP432 8.4898733 -13.2330815-59','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-05 12:13:01','2020-01-05 12:22:19'),(60,1,NULL,'Choitherams Memorial Hospital','Choitherams Memorial Hospital',414,1558,1558,1558,'place','WP437 8.453563599999999 -13.248466099999973','Hill Station, Freetown, Sierra Leone',8.45356360,-13.24846610,'[{\"is_active\":false,\"timeFrom\":nu