ith consistency, an affinity for Excellence in Education by relentlessly providing a model for a Balanced and High Quality Education at the secondary level in Sierra Leone. Its graduates have also occupied prominent positions of trust, altruism, and responsibility in Sierra Leone as well as in the international community. \r\nThe Prince of Wales Alumni Association-Georgia Branch was founded in 2002 by a cohort of former Students of the Prince of Wales Secondary School residing in the United States who not only saw the need for substantial financial, material and infra-structural support to their alma mater but also were prepared to make the necessary sacrifices destined to improve the quality of teaching and learning at the Prince of Wales School in Sierra Leone. Their patriotic zeal coupled with their conviction that they could make a difference in improving the human condition as well as positively influence posterity gave birth to the Prince Of Wales Alumni Association - Georgia Branch, U.S.A.',408,1543,1543,1543,'place','WP431 8.4917617 -13.2473162-73','Battery St, Freetown, Sierra Leone',8.49176170,-13.24731620,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000','Email - hello@pow.com','Website: www.powsl.com',1,'2020-01-06 22:48:25','2020-01-06 22:52:09'),(74,1,NULL,'St Edwards Secondary School','St. Edward\'s origins began with St. Edward\'s Primary School which was established in 1865 by a French Roman Catholic priest, Rev. Father Edward Blanchet.[1] In 1921, the board of directors which consisted of a group of priests from Italy, France and Ireland decided to start a secondary school for the students. On February 6, 1922, the new secondary school opened its doors to seven St. Edward\'s Primary School graduates: Anthony Tucker, Sylvester Tucker, James Massallay, Edward Farrah, William Luke, Joseph Luke and Albert M. Margai - future prime minister of Sierra Leone. At that time, the secondary school was located at the same address as the primary school at Howe Street in Freetown. St. Edward\'s is the third oldest secondary school in Sierra Leone. \r\nThe first head master of St. Edward\'s was Father Michael O\'Connor, but six months after the school opened, Father O\'Connor retired due to illness and was replaced by Father Mulcahy. Under the stewardship of Father Mulcahy, St. Edward\'s Secondary School became a first rate academic institution which followed a strict, old-fashioned British curriculum and enforced discipline by means of corporal punishment. The sports programs at St. Edward\'s became a source of general admiration. \r\nToday, the school continues to be managed by a board of directors and the disciplinary committee remains intact. St. Edward\'s has maintained its longstanding traditions, which include a Scripture Union, a Literary Society and a Debating Society. The school also has a boy scout troop known as 8th Freetown. \r\nSt. Edward\'s is still widely held to be one of the best schools in the country. On May 1, 2000, headmaster J.P. Kamara and the school\'s Parent/Teacher Association started a Development Committee to facilitate the expansion of the school.',408,1543,1543,1543,'place','WP431 8.4880417 -13.24590349999994','Rolling St, Freetown, Sierra Leone',8.48804170,-13.24590350,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-06 22:54:31','2020-01-06 22:54:31'),(75,1,NULL,'Christ the King College (CKC)','Christ the King College (CKC) is a secondary school founded in 1954 in Bo, Sierra Leone, Sierra Leone. The school was founded by Mother Marie Louise De Meester in 1954 under the direction of Archbishop Thomas Joseph Brosnahan. The Christ the King College is regarded as one of the most influential schools in West Africa due to its tradition of hardworking teachers and student leadership. Academically, it is considered the leading secondary school in public examinations such as Basic Education Certificate Educations (B.E.C.E) as well as the higher West African Senior Secondary School Examination Council.[citation needed] CKC primarily serves Sierra Leone, but also has international students from Liberia, Gambia, Ghana and Nigeria.[citation needed] Many prominent politicians and business leaders have graduated from CKC.\r\nUnder the direction of Archbishop Thomas Joseph Brosnahan, Christ the King College was founded and built by Roman Catholic missionaries of the Holy Ghost Order led by Reverend Michael Corbett of Mitchelstown, County Cork, Ireland. \r\nThe school itself was founded by Mother Marie Louise De Meester in 1954. When the first students arrived, Archbishop Joseph Ganda,[1] who was a Deacon at the time, was a French teacher at the school. \r\nThe original site later became the St Francis Primary School. \r\nBecause of the school\'s reputation, it became the favorite of Sierra Leone\'s most prominent families and it soon saw the children of paramount chiefs and politicians among its student body earning it the moniker \"The Royal College of the South\".',408,1543,1543,1543,'place','WP431 7.9830225 -11.736583600000017','Unnamed Road, Bo, Sierra Leone',7.98302250,-11.73658360,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-06 23:00:15','2020-01-06 23:00:15'),(76,1,NULL,'St. Joseph\'s Convent','After the American Revolution the English Government purchased from native chiefs a tract of land some twenty miles square, and established a colony for negroes discharged from the army and navy, and for liberated or runaway slaves who had sought refuge in England. In 1787 about 400 negroes settled there and founded Freetown. In 1808 it became a crown colony, and is so still. It has a completely-developed system of government.\r\n\r\nProtestantism had exclusive control in the colony until Catholicism appeared in 1864. Amongst many sects Wesleyans predominate, though Anglicans are numerous. All are strongly organized. In the surrounding territory the aborigines are pagans. Mohammedanism is spreading and becoming a dangerous enemy to Catholicism.\r\n\r\nThe history of West-African Catholic missions begins in 1843 with the foundation of the Vicariate Apostolic of the Two Guineas by Bishop Barron of Philadelphia with the Holy Ghost Fathers. This vicariate, which after Bishop Barron\'s departure in 1845 was completely entrusted to these fathers, was divided in 1858, and a special vicariate comprising Sierra Leone, Liberia, and French Guinea was confided to Bishop Bresillac, founder of the African Fathers of Lyons.\r\n\r\nHe with his companions died two months after reaching Freetown, and the vicariate was given back to the Holy Ghost Fathers. At the earnest request of the Propaganda Fathers Blanchet and Koeberle, C.S.Sp., began work in 1864. The French Guinea mission was begun in 1876 from Freetown, and fostered until its erection into a prefecture m 1897.\r\n\r\nThe Liberian mission was undertaken by Fathers Lorber and Bourzeix, C.S.Sp., in 1884, but because of opposition they withdrew in 1888 and confined their efforts to Sierra Leone. Liberia was erected into a prefecture in 1903 and given to the Fathers of Mary. The present Vicariate of Sierra Leone was administered by the Holy Ghost Congregation since 1864, Fathers Blanchet and Brown having the title of pro-vicar Apostolic.\r\n\r\nAfter Father Brown\'s death in 1903, Rt. Rev. John A. O\'Gorman of the American province of the congregation was named vicar Apostolic, and consecrated at Philadelphia. Despite the difficulty of climate and religious opposition the vicariate has prospered. At Father Brown\'s death there were five missions; since Bishop O\'Gorman\'s consecration six new ones have been added, making eleven in all.\r\n\r\nThere are twenty-eight missionaries, six from the American province. Connected with each mission is a school, and with it a workshop, farm, or plantation. Thus with religious and secular instruction the boys receive a practical training. A high school for boys was built at Freetown in 1911.\r\n\r\nThere are four schools, one high school, and one orphanage for girls, in care of the Sisters of St. Joseph of Cluny. The Venerable Mother Javouhey, their foundress, labored here herself in 1822. Since 1866 her daughters have been in continuous charge. With religious and secular education they teach cooking, sewing, and laundering.\r\n\r\nMOCKLER FERRYMAN, British West Africa, its Rise and Progress (London, 1900); STANLEY AND OTHERS, Africa, Its Partition and Its Future (New York, 1898); BLANCHET, Histoire de la mission de Sierra Leone, 1864-1892 (op. inedit.); Bulletin officiel of the Congregation of the Holy Ghost (Paris, 1863-1911); CROOKS, A Short History of Sierra Leone (Dublin 1900).\r\n\r\nJOSEPH BYRNE',410,1550,1550,1550,'place','WP433 8.4783249 -13.24709310000003','Motor Main Rd, Freetown, Sierra Leone',8.47832490,-13.24709310,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 05:10:10','2020-01-07 05:10:10'),(77,1,NULL,'Fourah Bay College','The college was established in February 1827 as an Anglican missionary school by the Church Missionary Society with support from Charles MacCarthy, the governor of Sierra Leone. Samuel Ajayi Crowther was the first student to be enrolled at Fourah Bay.[2] Fourah Bay College soon became a magnet for Krio and other Africans seeking higher education in British West Africa. These included Nigerians, Ghanaians, Ivorians and many more, especially in the fields of theology and education. It was the first western-style university in West Africa. Under colonialism, Freetown was known as the \"Athens of Africa\" due to the large number of excellent schools in Freetown and surrounding areas.\r\n\r\nThe first black principal of the university was an African-American missionary, Reverend Edward Jones from South Carolina, United States. Lamina Sankoh was a prominent early academic; Francis Heiser was principal from 1920 to 1922. Abioseh Nicol was the first Sierra Leonean administrator in 1966.',404,1536,1535,1536,'place','WP427 8.4772743 -13.220969400000058','Unnamed Road, Freetown, Sierra Leone',8.47727430,-13.22096940,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 05:30:00','2020-01-07 05:30:00'),(78,1,NULL,'Milton margai College of Education','Milton Margai Teachers College was founded in 1963, and was originally housed at Tower Hill in Freetown. The mission of MMTC was to train teachers for the lower levels of secondary school (Forms 1 - 3).\r\n\r\nUntil 1967 graduates of MMTC were awarded either a Teacher\'s Certificate (TC), or a Teacher\'s Advanced Certificate (TAC). In 1967 a new three-year programme was introduced, the curriculum was restructured, and both the TC and TAC where phased out and replaced with the Higher Teachers Certificate (HTC). \r\nIn 1995, in response to the needs of the new 6-3-3-4 system of education, a Bachelor of Education (B.Ed) degree programme was introduced. The 6-3-3-4 system involves six years of primary schooling, three years of junior secondary schooling (JSS), three years of senior secondary schooling (SSS), and four years of tertiary education. The Bachelor of Education degree programme was introduced in the specialist subject areas of Physical and Health education, Performing arts, Practical Arts, Technical Studies, Business Studies, Secretariat Studies, Integrated Science, Indigenous Languages (include the Mende, Temne, Limba and Krio), Community Development Studies, Social Studies and Religious and Moral Education. This significant restructuring of the curriculum meant a change in the depth and breadth of the education offered, and the name was changed to Milton Margai College of Education (MMCE) to reflect this. \r\n\r\nIn 2000, Milton Margai College of Education merged with Freetown Technical Institute (FTI) at Congo Cross, and the Hotel and Tourism Training Institute at Brookfields, to become the Milton Margai College of Education and Technology. This latest restructuring transforms the college into a Polytechnic. The programmes at MMCET are divided into four faculties, Education, Engineering (Civil, Electrical, & Mechanical), Science and Technology, and Business and Management, including Hotel and Tourism.\r\n\r\nThe merger brought about a reconstruction of both staff and student administrative units. Within the staff unit, Dr. Dennis Kargbo was appointed Principal of the MMCET.',366,1464,1463,1464,'place','WP389 8.4243323 -13.284535300000016','Unnamed Road, Freetown, Sierra Leone',8.42433230,-13.28453530,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 05:36:17','2020-01-07 05:36:17'),(79,1,NULL,'Institute of Public Administration and Management (IPAM)','The Institute of Public Administration and Management (IPAM) is an institute of the University of Sierra Leone. It operates like other constituent colleges of the University of Sierra Leone, under the authority of the University Senate and the University Court. IPAM is in the centre of Freetown at AJ Momoh Street, Tower Hill, close to the British Council, Statistics Sierra Leone, the West African Examination Council (WAEC) and the National Fire Force headquarters. The institute has four departments offering a range of business, information technology, finance and public administration courses to the public. \r\n\r\nThe establishment of IPAM can be traced to 1970. It came as a result of a government white paper on education which proposed the closure of the Civil Service Training College. The responsibility for the training of middle- and upper-level staff was transferred to Fourah Bay College and that of the clerical cadre to the Freetown Technical Institute.\r\n\r\nSubsequent review by the World Bank suggested the need for a more specialised establishment in public administration and management. Discussions between the World Bank and the government of Sierra Leone resulted in the decision to establish the Institute of Public Administration and Management as an institute of the University of Sierra Leone.\r\n\r\nFunds were made available under the Second IDA Education Project for construction of suitable accommodation for the institute. The building on the site of the then Civil Service Training College was occupied in June 1980 and the institute started work in the 1980/81 academic year. \r\n\r\nThe institute is managed by a dean of campus (formerly director) who reports directly to the vice-chancellor and principal of the University of Sierra Leone. A management team comprises the dean of campus, assistant dean of campus, deputy registrar and all heads of departments (administrative and academic).',405,1537,1537,1537,'place','WP428 8.4854749 -13.2320076-79','17 British Council Road, Freetown, Sierra Leone',8.48547490,-13.23200760,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 05:48:33','2020-01-07 05:49:38'),(80,1,NULL,'Njala University','Njala University (NU) is a public university located in Njala and Bo, Sierra Leone. It is the second largest university in Sierra Leone (after the Fourah Bay College) and is also part of the University of Sierra Leone. The largest and main campus of Njala University is in Njala, Moyamba District; the other campus is Bo, the second largest city in sierra leone. \r\n\r\nNU was originally created as part of the University of Sierra Leone (USL) in 1964 with the help of USAID and offered degrees in conjunction with the University of Illinois. Subsequent legislation in 1972 paired Fourah Bay and Njala under the University of Sierra Leone act, where the presidents of each institution switched the presidency of the USL on a biennial basis. This continued until 2005, when the University act separated Fourah Bay and NU into distinct institutions independently run.',22,65,62,65,'place','EP022 7.935680799999999 -11.765798700000005','Unnamed Road, Bo, Sierra Leone',7.93568080,-11.76579870,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 05:58:41','2020-01-07 05:58:41'),(81,1,NULL,'Limkokwing University of Creative Technology','Limkokwing University of Creative Technology (also referred to as Limkokwing) is a private international university that has a presence across Africa, Europe, and Asia. With its main campus in Malaysia, the university has over 30,000 students from more than 150 countries, studying in campuses in Kuala Lumpur, Melaka, Kuching, Botswana, Cambodia, Lesotho, Sierra Leone, Eswatini, Uganda, and the United Kingdom.[1][2]\r\n\r\nIt is considered to be one of the top arts and design schools in Asia, and is ranked highly among Asian universities in the QS Rankings\r\nLimkokwing Institute of Creative Technology (as it was then known) was established in 1991 by founder and namesake Tan Sri Dato’ Sri Paduka Dr Limkokwing. In 2002 the institute became the first private college to be recognised as a University College.[\r\n\r\nThe Limkokwing Sierra Leone campus in Freetown, opened in March 2017',414,1558,1558,1558,'place','WP437 8.451275899999999 -13.239201099999946','Unnamed Road, Freetown, Sierra Leone',8.45127590,-13.23920110,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 06:11:12','2020-01-07 06:11:12'),(82,1,NULL,'University of Makeni','Established in 2005, University of Makeni is a private higher education institution located in the urban setting of the large town of Makeni (population range of 50,000-249,999 inhabitants), Northern Province. Officially accredited and/or recognized by the Ministry of Education, Science and Technology, Sierra Leone, University of Makeni (UNIMAK) is a coeducational higher education institution formally affiliated with the Christian-Catholic religion. University of Makeni (UNIMAK) offers courses and programs leading to officially recognized higher education degrees in several areas of study.',211,871,871,871,'place','NP211 8.8891321 -12.055336399999987','Lunsar-Makeni Highway, Makeni, Sierra Leone',8.88913210,-12.05533640,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 06:27:37','2020-01-07 06:27:37'),(83,1,NULL,'The Methodist Girls High School','The Methodist Girls High School has in the 125 years of its existence sought to reduce the gender disparity in education, and promote the access of young girls of Sierra Leone to secondary education.​\r\n\r\n The school’s vision is to pursue high quality education and contribute to high standards, by training well-motivated pupils who should achieve their full potential in all aspects of life.',415,1560,1560,1560,'place','WP438 8.4780183 -13.256148899999971','College Rd, Freetown, Sierra Leone',8.47801830,-13.25614890,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 13:57:15','2020-01-07 13:57:15'),(84,1,NULL,'T.I Ahmadiyya Secondary School','T.I Ahmadiyya Secondary School is a secondary school in Freetown, Sierra Leone.[1] In the country, the school is known for its academic output and for its production of sportsmen and women.[1] It is one of the 55 Ahmadiyya secondary schools in the country.\r\n\r\nThe earliest history of the Ahmadiyya Muslim Community in Sierra Leone can be traced to the year of 1916, during the early period of the Second Caliphate. In that year at least six people are said to have conveyed their adherence to the Ahmadiyya faith, after being influenced by the circulation of Ahmadiyya literature in Sierra Leone from neighbouring West African nations.[1] However, it was not until almost half a decade later, in February 1921, that the first missionary of the Community, Abdur Raheem Nayyar, would set foot on the territory. Nayyar stayed temporarily in the capital Freetown, whilst he was on his route towards Saltpond, in modern-day Ghana, and Lagos, in Nigeria for his missionary activities. At the request of the chief Imam of the city, he gave a lecture at a mosque in Fourah Bay, a town in the east end of Freetown. A year later, in 1922, another missionary of the Community, Fadl-ul-Rahman Hakim paid a short visit to the country. Like Nayyar, Hakim was on his way to Lagos, Nigeria. Nevertheless, there are no recorded conversions from either of the visits.[1]\r\n\r\nAfter an interval of 15 years, Nazir Ahmad Ali arrived in 1937 as a permanent missionary to Sierra Leone. Ali had spent a year at the Gold Coast, modern-day Ghana, after his arrival from India. Upon the year of his arrival, Ali settled in Freetown, and established the Ahmadiyya Muslim Community of Sierra Leone. Before long, he gave a lecture at the Wilberforce Memorial Hall,[1] the principal public meeting place of the city,[2] addressing the Muslim and Christian populations of the country. In this early address, he introduced the Community and the coming of Mirza Ghulam Ahmad as the Imam Mahdi for the Muslims, and the second coming of Jesus for the Christians. At another event, he solely addressed Muslims at the Islamia School adjacent to a Mandinka mosque.[1] Such addresses directed at the Muslim populations often gave rise to hostilities from Muslim communities. Perhaps for his safety, Ali moved into the house of Kande Bure, chief of the Temne people of Freetown, and a Cabinet minister.[3]\r\n\r\nHowever, having been rejected by the majority of Muslim groups in Freetown, Ali decided to move to a coastal town, Mange Bure, in the Port Loko District. Kande Bure himself was born in Mange Bure, where his father was an influential political figure. Having achieved little success in his preaching efforts, Ali moved; this time in the same district to the small port-town of Rokupr.[3] Here Ali had reasonable success, where he managed to establish a small community of Ahmadi Muslims, among them a number of local influential figures. Rokupr was also the site of the first school established by the Ahmadiyya Muslim Community of Sierra Leone',390,1511,1510,1511,'place','WP413 8.4806163 -13.204474900000037','King George Ave, Freetown, Sierra Leone',8.48061630,-13.20447490,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 14:07:10','2020-01-07 14:07:10'),(85,1,NULL,'The Sierra Leone Grammar School','The Sierra Leone Grammar School was founded on 25 March 1845 in Freetown, Sierra Leone, by the Church Mission Society (CMS), and at first was called the CMS Grammar School. It was the first secondary educational institution for West Africans with a European curriculum. Many of the administrators and professionals of British West Africa were educated at the school. \r\n\r\nThe Church Mission Society founded Fourah Bay College in 1827 to provide training for African missionaries. As the academic standards of the college rose, the regular schools in the region were unable to produce students with sufficient education to be admitted to the college. The grammar school was founded to fill the gap. The CMS obtained a lease on a massive building with arches on all sides at Regent Square, Freetown, that until recently had been the house of the Governor.[1] Opening on 25 March 1845, the CMS Grammar School was the first secondary education institution in Sierra Leone and the first in sub-Saharan Africa for Africans.[2][3]\r\n\r\nThe CMS Grammar School offered a western-style curriculum that included Greek, Latin, Astronomy and Music.[2] Other subjects were English, French, Bible Knowledge, Mathematics, Science, Geography, History, Recitation and Physical Education. The school began with 14 pupils from Fourah Bay College.[3] At first the main purpose was to train people who would go on to become missionaries, so all pupils were expected to convert to Christianity.[',417,1562,1562,1562,'place','WP440 8.4936735 -13.265836000000036','Macaulay St, Freetown, Sierra Leone',8.49367350,-13.26583600,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 14:15:49','2020-01-07 14:15:49'),(87,1,NULL,'Lebanese School Freetown','Lebanese School Freetown',410,1551,1550,1551,'place','WP433 8.4726544 -13.2496337-87','24 Old Railway Line, Freetown, Sierra Leone',8.47265440,-13.24963370,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 14:26:29','2020-01-09 07:44:29'),(88,1,NULL,'IAMTECH','The chronicle of the Institute of Advanced Management and Technology (IAMTECH) speaks volumes and constitutes distinct milestones of which the founders/proprietors, students and our country should be proud. It all started 29 years ago as a small training centre. Since then it has developed progressively into the most competitive and productive tertiary educational institution in the country.\r\n\r\nThe Chronicle of the noble institution of which we are all proud of, this article presents a brief synopsis of its steady progress since its inception. Initially known as the Kissy Computer Training Institute (KCTT), it has responded to the demands of the age with alacrity. On the 16th July 1991, history was made, the former KCTT successfully worked its way up and assumed the status of an incredibly, accredited tertiary educational institution with the enviable bent for modern computer science and technology and other relevant training skills and qualifications which are required for the socio-economic development of our country. Since then it has been renamed the Institute of Advanced Management and Technology (IAMTECH).',390,1511,1510,1511,'place','WP413 8.4806355 -13.200423699999988','Hospital Rd, Freetown, Sierra Leone',8.48063550,-13.20042370,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 14:35:07','2020-01-07 14:35:07'),(89,1,NULL,'College of Medicine and Allied Health Sciences (COMAHS)','The College of Medicine and Allied Health Sciences (COMAHS) the first medical school in Sierra Leone was founded on 12th April 1988 by the Government of Sierra Leone with the Nigerian Government and the World Health Organization. COMAHS is mandated to producing doctors, nurses, pharmacists, biomedical scientists and laboratory technicians with a view to improving the health care delivery system in Sierra Leone. It has four faculties: Basic Medical Sciences, Clinical Sciences, Nursing and Pharmaceutical Sciences.',373,1486,1483,1486,'place','WP396 8.487120599999999 -13.237930099999971','1a Liverpool St, Freetown, Sierra Leone',8.48712060,-13.23793010,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 15:04:15','2020-01-07 15:04:15'),(90,1,NULL,'Action Aid Sierra Leone','We\'re a global justice federation working to achieve social justice, gender equality and poverty eradication.\r\n\r\nIn Sierra Leone our priorities include women’s rights, the rights to food, education, security and the right to just and democratic governance.',414,1559,1558,1559,'place','WP437 8.479138599999999 -13.264824200000021','30 Signal Hill Rd, Freetown, Sierra Leone',8.47913860,-13.26482420,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 15:26:18','2020-01-07 15:26:18'),(91,1,NULL,'World Hope Freetown','The roots of World Hope International (WHI) can be traced back to the vision and heart of our dynamic founder, Jo Anne Lyon. From a humble start in 1996, God has blessed Jo Anne’s journey to serve those crippled by poverty. Her hope:\r\n\r\nTo empower the poorest of the poor around the world so they can become agents of change within their communities.\r\n\r\n\r\n\r\nWhat began in the back bedroom of her home, grew into a leading-edge Christian relief and development organization, recognized by partners and governments alike as a successful service model for those in need. For more than 10 years, Jo Anne entered into war-torn regions, abandoned communities and dark pockets of the world teeming with forced labor and prostitution. She looked at the bleakness and despair and saw how she could bring glimmers of light through opportunity, dignity, and hope.\r\n\r\nThough Jo Anne stepped down as WHI’s CEO in 2008 to accept a prominent leadership role within The Wesleyan Church, she remains actively involved as a member of our Board of Directors. Today, current WHI President and CEO John Lyon carries out Jo Anne’s original hope, empowering the poorest of the poor to become changemakers within their own communities.\r\n\r\nToday, WHI continues its mission as a voice for the silent, an opportunity for the oppressed and water for those who thirst. WHI helps provide the dignity that comes from an educated mind, a healthy body, an honest day’s wage and a safe place to heal. WHI is the one who comes alongside those gripped by poverty to offer a hand up instead of a handout. But more than anything, WHI is the reflection of Jesus Christ’s compassion for all who suffer.',419,1567,1565,1567,'place','WP442 8.4742481 -13.2753153-91','Wilkinson Road, Freetown, Sierra Leone',8.47424810,-13.27531530,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 15:36:36','2020-01-07 18:06:27'),(92,1,NULL,'Save The Children','Within Save the Children the Sierra Leone CO becomes a leader in delivering integrated programmes.\r\n\r\n Within Sierra Leone, Save the Children is the organisation known as giving a voice to children.\r\n\r\nSave the Children seeking solutions to the challenges faced by children in Sierra Leone\r\n\r\nIn order to attain our ‘survive’ breakthrough in Sierra Leone by 2030 we aim to demonstrate Kailahun as a model district health system for rural areas, with universal coverage of all health related child survival interventions. This will be advocated for as a model for replication by SC and other agencies to scale up interventions nationwide under the leadership and ownership of MOHS.',416,1561,1561,1561,'place','WP439 8.4752665 -13.2560555-92','4c Old Railway Line, Freetown, Sierra Leone',8.47526650,-13.25605550,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,3,'2020-01-07 16:20:15','2020-01-07 18:17:47'),(93,1,NULL,'USAID','USAID is the world\'s premier international development agency and a catalytic actor driving development results. USAID works to help lift lives, build communities, and advance democracy. USAID\'s work advances U.S. national security and economic prosperity; demonstrates American generosity; and promotes a path to recipient self-reliance and resilience.\r\n\r\nU.S. foreign assistance has always had the twofold purpose of furthering America\'s interests while improving lives in the developing world. USAID carries out U.S. foreign policy by promoting broad-scale human progress at the same time it expands stable, free societies, creates markets and trade partners for the United States, and fosters good will abroad.',414,1559,1558,1559,'place','WP437 8.4794463 -13.2608259-93','39 Freetown Rd, Freetown, Sierra Leone',8.47944630,-13.26082590,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,1,'2020-01-07 16:41:39','2020-01-07 18:19:26'),(94,1,NULL,'Concern Worldwide','We are an international humanitarian organisation that strives for a world free from poverty, fear and oppression. \r\n\r\nWe deliver life-saving and life-changing interventions to the world\'s poorest and most vulnerable people. From rapid emergency response to innovative development programming, we go to the hardest to reach places to make sure that no-one is left behind.',413,1557,1556,1557,'place','WP436 8.4697169 -13.2473827-94','23a Cantonment Rd, Freetown, Sierra Leone',8.46971690,-13.24738270,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]','Contact: +232000000',NULL,NULL,NULL,'2020-01-07 16:49:10','2020-01-07 18:07:26'),(95,1,NULL,'DFID Sierra Leone','DFID International Sierra Leone',414,1559,1558,1559,'place','WP437 8.4707397 -13.2661947-95','31 Spur Rd, Freetown, Sierra Leone',8.47073970,-13