otel.\r\n\r\nEach room here will provide you with a TV, air conditioning and a seating area. There is also a refrigerator and complementary tea and coffee making facilities. Featuring a shower, the private bathroom also comes with free toiletries. You can enjoy a mountain, sea or city view from the room. The property offers free parking and free WiFi.\r\n\r\nIf you’d rather not drive we do offer an airport transfer service to or from the airport, this is bookable when you book your room.  The rates are $120 each way for our Executive Service, or $60 for our standard service.',419,1565,1565,1565,'place','WP442 8.4618642 -13.2692752-99','38 Spur Rd, Freetown, Sierra Leone',8.46186420,-13.26927520,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]','+23231200200',NULL,NULL,12,'2020-01-08 14:43:48','2020-01-08 16:04:01'),(100,1,NULL,'Advertise Here','<p>Advertise and describe your Business Here</p>',409,1549,1546,1549,'place','WP432 8.4804045 -13.2395364-100','7 Robert St, Freetown, Sierra Leone',8.48040450,-13.23953640,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]','+23231200200',NULL,NULL,NULL,'2020-01-08 15:04:56','2020-10-03 05:47:59')