additional withdrawal attracts a charge.\r\n    Cheques to be issued for withdrawals at any branch of the Bank.\r\n\r\nBENEFITS\r\n\r\nAs a hybrid account, it gives customers the unique opportunity to invest and earn more\r\nConvenient, fast and easy banking and access to a cheque book\r\nCheques to be issued for withdrawals at any branch of the Bank\r\nAccount will serve as collateral for loans and/or overdraft.\r\n\r\nMODE OF OPERATION\r\n\r\nAccount will be operated as a hybrid account of savings and current accounts\r\nAccount will be opened and operated after full documentary and Know Your Customer (KYC)',409,1549,1546,1549,'place','WP432 8.4899417 -13.2329816-254','27 Rawdon St, Freetown, Sierra Leone',8.48994170,-13.23298160,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-17 11:42:46','2020-01-17 12:50:25'),(255,1,NULL,'Zenith Children’s Account (ZECA)','The Zenith Bank Children’s Account is a unique savings account designed to allow parents save for their children’s future and teach them about savings from a tender age. The account is modeled in two tiers for young children and teens with an overarching objective of making savings fun for them and teaching them financial discipline.\r\n\r\nFEATURES\r\n\r\nSavings account for children 0-18 years\r\nCompetitive interest rate\r\nThe number of withdrawals allowed is once per month\r\nAccount can be opened at birth\r\nWithdrawals can be made using customized slips\r\nChild takes over when ready after 18 years and may operate as current or savings account.\r\n\r\nBENEFITS\r\n\r\nEncourages parents to save for their children\r\nInculcates a savings habit in children at an early age.\r\nHelps parent plan for children´s education\r\nUse of account balance as collateral for credit from the bank.\r\nLarger deposits earn more interest\r\n\r\nMODE OF OPERATION\r\n\r\nBasically a savings account that will be operated through passbook on behalf of the child.\r\n\r\nREQUIREMENTS\r\n\r\nMeans of Identification ( Passport or Drivers License of parent/guardian who will operate the account on behalf of the beneficiary\r\nTwo passport photographs of parent/guardian and that of child(ren)\r\nMandate cards completed by parent/guardian',409,1549,1546,1549,'place','WP432 8.4898733 -13.2330815-255','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-17 11:46:29','2020-01-17 12:50:42'),(256,1,NULL,'Salary Savings Account','The Zenith Salary Account is designed to provide you easy and convenient access to your funds because you have worked hard for it. In addition, because we wish to build with you, this account offers the opportunity for several other employee benefits and enhanced banking experience.\r\n\r\nFEATURES:\r\n\r\nZero account opening balance\r\nAs account holder, you can personally transact from any branch of Zenith nationwide\r\nEarn interest at 3.6%\r\nA MasterCard or Visa debit card for cash withdrawals and payments for good and services anywhere in the world\r\nIn addition, Verve debit card is available on request\r\nGet notified for every account activity via of email and/or SMS Alertz.\r\n\r\nREQUIREMENTS\r\n\r\nAccount opening form\r\nOne passport photograph of authorized signatory\r\nLetter of introduction from your employer on the company’s letterhead\r\nStaff identity card\r\nShould you want to deposit cheques into account – Two (2) references.\r\n\r\nAVAILABLE CHANNELS\r\n\r\nZenith Internet Banking\r\nIn-branch at any Zenith Bank branch\r\nZenithDirect – our 24/7 telephone banking\r\nZenith Bank ATM nation wide – free cash withdrawal\r\nZenith Mobile Banking App – 24/7 on your smart phone\r\nAccess your account using your Zenith Bank debit card at participating merchant stores for payment of goods and services in Sierra Leone and anywhere in the world.',409,1549,1546,1549,'place','WP432 8.4898733 -13.2330815-256','17 Rawdon St, Freetown, Sierra Leone',8.48987330,-13.23308150,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-17 11:55:01','2020-01-17 12:51:11'),(257,1,NULL,'Ordinary Domiciliary Account','Need a foreign currency account? Our domiciliary accounts gives you the opportunity to conveniently carry out foreign transactions wherever you may be. With access to our debit cards, internet banking, and mobile banking application , your transfers, payments, standing orders etc. can be done without you walking into our banking halls.\r\n\r\nZero opening balance\r\nInternet Banking\r\nDebit Card\r\nEmail/SMS Alertz\r\nStanding orders\r\nUSD, GBP & EUR\r\n\r\nREQUIREMENTS\r\n\r\nAccount opening form (existing account holders with full documentation only require a written letter or completion of a