timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-17 19:20:03','2020-01-18 18:15:47'),(279,1,NULL,'Tokeh Beach','Tokeh also known as Tokeh Town is a coastal resort town along the peninsula in the Western Area Rural District of Sierra Leone. Tokeh lies approximately twenty miles east of Freetown and near the neighborhood town of York. The major economic activity in Tokeh is fishing and tourism. Tokeh is home to a large resort called “The Place” and other accommodation facilities of relatively high standards. The Tokeh beach is one of the largest and most attractive beaches in West Africa. Tokeh is also known for its mountains, forests, resort hotels, and nearby Tokeh Island, an uninhabited island a short boat ride from Tokeh town.',365,1461,1460,1461,'place','WP388 8.3148589 -13.1947493-279','Unnamed Road, Sierra Leone',8.31485890,-13.19474930,'[{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"},{\"is_active\":true,\"timeFrom\":\"00:00\",\"timeTill\":\"24:00\"}]',NULL,NULL,NULL,NULL,'2020-01-18 16:19:53','2020-01-18 18:20:03'),(280,1,NULL,'Lakka Beach','Lakka is a coastal resort town around the peninsular in the Western Area Rural District of Sierra Leone. The town lies about ten miles west of Freetown. The major industry in Lakka town is tourism and fishing. Lakka is known for its large beaches, which attract tourists to the town. The inhabitants of Lakka are mainly fishermen. Lakka town is home to its own hospital, a number of hotels, as well as several primary schools and a secondary school.',363,1456,1454,1456,'place','WP386 8.3980798 -13.2680758-280','Unnamed Road, Sierra Leone',8.39807980,-13.26807580,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-18 16:27:42','2020-01-18 18:23:55'),(281,1,NULL,'Lumley Beach','This beach stretches for some 1.5 miles and it is perfect for a walk. On weekends there are a lot of friendly people playing football and this is a good chance to socialize with the locals. There are also few nice beach bars and restaurants nearby if you wish to have a cold drink or so. Lumley Beach is the most visited beach in Freetown, at the heart of the city and has the highest concentration of tourist facilities in the country.',419,1565,1565,1565,'place','WP442 8.4743759 -13.2831891-281','Lumley Beach Rd, Freetown, Sierra Leone',8.47437590,-13.28318910,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-18 16:29:26','2020-01-18 18:25:52'),(282,1,NULL,'Black Johnson Beach','About Black Johnson Beach',365,1461,1460,1461,'place','WP388 8.2785146 -13.1663856-282','Unnamed Road, Sierra Leone',8.27851460,-13.16638560,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\