eli Island',143,529,529,529,'place','NP143 8.5448331 -12.9012246-288','Unnamed Road, Sierra Leone',8.54483310,-12.90122460,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-18 21:29:32','2020-01-19 11:43:41'),(289,1,NULL,'Mt. Bintumani','About Mt. Bintumani',227,925,924,925,'place','NP227 9.5308619 -11.5248055-289','Koinadugu, Sierra Leone',9.53086190,-11.52480550,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-18 22:00:44','2020-01-19 11:27:36'),(290,1,NULL,'Old Wharf Steps','When Sir Charles MacCarthy took over the Governorship of the Colony, there were very few stone buildings in Freetown, public or private. He started erecting public buildings constructed with stones; for example, a magnificent commissariat building was put up at the Government Wharf. He had the whole wharf rebuilt with stone breakwaters. He also ordered that a flight of stone steps be constructed. This was completed in 1818.\r\n\r\nThese are the steps between the lower Commissariat (where the offices of the National Electoral Commission are now located) and the French Company building (the huge refurbished building which houses the Auditing Company, KPMG) leading down from Water Street (now Wallace Johnson Street) to the landing stage. The scenic view was so fetching that someone once commented that this wide handsome flight of steps resembled a stream of water cascading down the wharf.\r\n\r\nThey are often being referred to as the “Portuguese steps”, which is quite erroneous as they were built centuries after the Portuguese had left this part of Africa. The Guard House at the top of the steps was built in 1819. MacCarthy who lived nearby, was out daily, superintending the work.',409,1549,1546,1549,'place','WP432 8.4908903 -13.2348353-290','Wallace Johnson St, Freetown, Sierra Leone',8.49089030,-13.23483530,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-18 23:01:07','2020-01-19 11:42:53'),(291,1,NULL,'Mamunta Mayoso Wildlife Sanctuary','The Mamunta Mayosso Wildlife Sanctuary is a game reserve in Tonkolili District, Northern Province, Sierra Leone. It is one of the few areas in the country that protects the threatened Dwarf Crocodile as well as being home to 252 bird species despite its small size. It is situated between Magburaka (30 km to the Northeast) and Yonibana (35 km to the Southwest). \r\n\r\nThis sanctuary is in the Kholifa and Mabang Chiefdoms, Tonkolili district, Northern Province, about 180 km east of Freetown. Located almost at the centre of the country, this sanctuary supports a wide range of vegetation types. The predominant vegetation is boliland (seasonally flooded grassland) with occasional occurrence of swamps, savanna, secondary forest and two perennial lakes. Water depths in swamps rise to 1.5 m during flooding. Mean annual rainfall ranges from 3048 to 3556 mm, Mean daily temperatures vary from 26-32 0C in the dry season, and 20-30 0C in the wet season. Relative humidity at 1500h varies between 50% and 80% annually. The area is founded on Precambrian-Bintumani granite rocks.\r\n\r\nBirds\r\n\r\nField (1979) and Tye and Tye (1987) produced bird lists for the area. These surveys listed a total of 252 species of birds belonging to 51 families. These include two near threatened species – Turati’s Boubou and Rufous-winged Illadopsis. A waterfowl census conducted at the two wetlands of Dakrafi and Robierra (Thompson, 1994) gave a total of 1280 birds of 18 species and includes a large count of the White-faced Whistling Duck.\r\nMammals and other fauna\r\n\r\nEight species of primates are known to occur in this sanctuary, in addition to other big game such as bushbuck, bushpig, genets and duikers. The threatened primate species are Western Chimpazee (En) and Red Colobus monkey (Vu). Other threatened fauna are Pigmy Hippo (NT) and Dwarf Crocodile.\r\nAccess and Facilities\r\n\r\nMayosso is on a motorable but untarred road that runs between Magburaka (30 km to the northeast) and Yonibana (35 km to the southwest). Yonibana (Mile 91) is on the Bo – Freetown highway. A dilapidated visitors centre, which needs urgent rehabilitation is situated on the Mayosso road. The communities within the vicinity of the reserve operate a raffia produce-manufacturing group that deals in high quality raffia products like handbags, baskets, hand fans etc. Makeni, which is the headquarter town in the Northern Province is within 50 km to the north.',305,1189,1186,1189,'place','SP305 8.5448421 -12.1116961','Unnamed Road, Sierra Leone',8.54484210,-12.11169610,'[{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null},{\"is_active\":false,\"timeFrom\":null,\"timeTill\":null}]',NULL,NULL,NULL,NULL,'2020-01-19 01:54:32','2020-01-19 01:54:32'),(292,1,NULL,'S. B. Thomas Agricultural Academy (Mabang College)','On the banks of the Ribbi River in Kholifa chiefdom there is an edifice of architectural significance called Mabang College that has regrettably remained hidden in plain sight for a century.\r\n\r\nThe foundation stone for the S. B. Thomas Agricultural Academy was laid by Governor Leslie Probyn on 28 January 1909 and was opened in 1912.\r\nGovernor Probyn was very supportive of this college and according to the Encyclopedia of Library and Information Science [3] used his influence to obtain 1000 acres of land in Mabang for the college and approved the grant of 12 scholarships worth £50 annually for a 4-year course in agriculture.  Three were given out each year.  This was in all likelihood one of the first, if not the first Agricultural Institution in West Africa.\r\n\r\nThere is very scant information about whether the building was ever used for its intended purpose or how long it functioned as an Agricultural College.  With the departure of Governor Probyn, the government interest in the college waned.  It was claimed that the land around Mabang was not very fertile; the surroundings unsanitary and potable water was not readily available.  Thus it appears that it soon became a “white elephant” and this was compounded by the fact that the Agriculture Department of the government then focused its attention on starting an Experimental Agricultural Station at Njala along the banks of the Taia River [Sumner].\r\n\r\nThus Mabang College became the forerunner of Njala Experimental Agricultural Station in 1912, Njala College founded in 1919, Njala University College, and now Njala University, founded in 1964.  The original aim of Njala College was to train teachers for government schools, agriculture being a subject of special study. However, for the first five years after its establishment there was no agricultural instructor on staff. [Rhodes]\r\n\r\nThe next significantly recorded historical occurrence of Mabang College is during the Second World War, when for six years, 1939 – 1945, it was home to the students from Fourah Bay College as the British army had commandeered Mount Aureol.  What happened to it in the intervening years?  After the end of the Second World War, it appears that it again faded from the consciousness of Sierra Leoneans.  In fact this hidden identity has prevailed to the extent that a magnificent photograph of the Academy -- perhaps the only surviving pictorial record of the grandeur of the building is captioned “Fourah Bay College Exile Quarters, Mabang” Of course this is because Fourah Bay College, the first institution of higher learning in Africa south of the Sahara, was using what the historian Christopher Fyfe described as  the “ill-fated Academy” as a temporary home during the second world war as stated above.',305,1188,1186,1188,'place','SP305 8.16069 -12.4356765-292','Unnamed Road, Moyamba, Sierra Leone',8.16069000,-12.43567650,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-19 02:25:31','2020-01-19 11:42:14'),(293,1,NULL,'Bumbuna Dam','The Bumbuna Dam is a concrete-face rock-fill dam on the Seli River near Bumbuna in Tonkolili ... The site for the dam at Bumbuna Falls was first identified in 1971, and construction was begun in 1975. Work was halted in May 1997, about 85% completed, due to the Sierra Leone Civil War, and did not restart until 2005.\r\n\r\nThe Bumbuna Dam is a concrete-face rock-fill dam on the Seli River near Bumbuna in Tonkolili District, Sierra Leone, and 350 kilometres (220 mi) from the capital of Freetown, the main consumer. The country\'s first hydroelectric dam, it supports a 50-megawatt (67,000 hp) power station.\r\n\r\nThe site for the dam at Bumbuna Falls was first identified in 1971, and construction was begun in 1975. Work was halted in May 1997, about 85% completed, due to the Sierra Leone Civil War, and did not restart until 2005. The project was completed and went online in 2009. Nearly a third of the dam\'s US$327 million cost ($103 million) was supplied by the African Development Bank. A 26 January 2005 report noted that 33 villages would be affected by the dam, although only one (of 16 households and 135 people) would require resettlement.\r\n\r\nThe dam has a maximum height of 87 metres (285 ft), a length of 400 metres (1,300 ft) at the crest and a volume of 2,500,000 cubic metres (88,000,000 cu ft).The volume of the reservoir created is 410,000,000 cubic metres (1.4×1010 cu ft),[2] 428,000,000 cubic metres (1.51×1010 cu ft) or 480,000,000 cubic metres (1.7×1010 cu ft). There are two Francis turbines, each rated for 25 megawatts (34,000 hp).\r\n\r\nAfter completion, the project has been plagued with problems, and barely produces 10 megawatts (13,000 hp) or 25 megawatts (34,000 hp) as of 2013.\r\n\r\nA second phase is planned, for a 110-megawatt (150,000 hp) power station. In June 2011, the government announced it had awarded the $750 million Phase II project to Joule Africa, a UK-based company. This will entail a second dam and plant. Construction was set to begin in 2014 and continue on until at least 2017.',227,925,924,925,'place','NP227 9.0686918 -11.7240702-293','Unnamed Road, Sierra Leone',9.06869180,-11.72407020,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-19 02:44:02','2020-01-19 02:44:25'),(294,1,NULL,'Loma Mounatains','About Loma Mountains',227,925,924,925,'place','NP227 9.5308619 -11.5248055','Koinadugu, Sierra Leone',9.53086190,-11.52480550,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-19 09:57:14','2020-01-19 09:57:14'),(295,1,NULL,'Sugarland Beach','About Sugarland Beach',363,1457,1454,1457,'place','WP386 8.421439 -13.2805099','Unnamed Road, Sierra Leone',8.42143900,-13.28050990,'[{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"},{\"is_active\":true,\"timeFrom\":\"09:00\",\"timeTill\":\"18:00\"}]',NULL,NULL,NULL,NULL,'2020-01-19 11:15:41','2020-01-19 11:15:41'),(302,1,'HQ','Sigma Ventures Ltd